from collections import defaultdict

def solution(coins, target):
    d = defaultdict(int)
    ans = 0
    roll = 0

    for coin in coins:
        d[coin] += coin

    for i in range(1, target+1):
        if i in coins:
            roll += d[i]
        else:
            if i > roll:
                print(i)
                ans += 1
                roll += i
    
    return ans


